import React from 'react'

function Education(props) {
    return (
        <main id='education'>
            <form>
                <h2> Education </h2>
                <input
                    name="schoolName"
                    value={props.data.firstName}
                    onChange={props.handleChange}
                    placeholder='First Name'
                />
                <br/>
            </form>
        </main>
    )
}

export default Education
